import React from "react";
import { NavLink } from "react-router-dom";
import Burger from "./Burger";
import { useState, useEffect } from "react";

function Navbar() {
  const [hamburgerOpen, setHamburgerOpen] = useState(false);

  const scrollTop = () => {
    window.scrollTo({
      top: 0,
      behavior: "smooth",
    });
  };

  const toggleHamburger = () => {
    setHamburgerOpen(!hamburgerOpen);
  };

  const [scrollPosition, setScrollPosition] = useState(0);

  useEffect(() => {
    const handleScroll = () => {
      setScrollPosition(window.scrollY);
    };
    window.addEventListener("scroll", handleScroll);
    return () => {
      window.removeEventListener("scroll", handleScroll);
    };
  }, []);
  return (
    <div>
      <nav className={scrollPosition > 1 ? "navbar-scroll" : "navbar"}>
        <div class="logo">
          <img src="./logo2.png" alt="logo" />
        </div>
        <ul className="links">
          <li>
            <NavLink
              to="/"
              onClick={() => {
                toggleHamburger();
                scrollTop();
              }}
              exact
              activeClassName="active"
            >
              Strona Główna
            </NavLink>
          </li>
          <li>
            <NavLink
              to="/onas"
              onClick={() => {
                toggleHamburger();
                scrollTop();
              }}
              activeClassName="active"
            >
              O nas
            </NavLink>
          </li>
          <li>
            <NavLink
              to="/oferta"
              onClick={() => {
                toggleHamburger();
                scrollTop();
              }}
              activeClassName="active"
            >
              Oferta
            </NavLink>
          </li>
          <li>
            <NavLink
              to="/przedszkole"
              onClick={() => {
                toggleHamburger();
                scrollTop();
              }}
              activeClassName="active"
            >
              Przedszkole
            </NavLink>
          </li>
          <li>
            <NavLink
              to="/aktualnosci"
              onClick={() => {
                toggleHamburger();
                scrollTop();
              }}
              activeClassName="active"
            >
              Aktualności
            </NavLink>
          </li>
          <li>
            <NavLink
              to="/rekrutacja"
              onClick={() => {
                toggleHamburger();
                scrollTop();
              }}
              activeClassName="active"
            >
              Rekrutacja
            </NavLink>
          </li>
          <li>
            <NavLink
              to="/kontakt"
              onClick={() => {
                toggleHamburger();
                scrollTop();
              }}
              activeClassName="active"
            >
              Kontakt
            </NavLink>
          </li>
        </ul>
        <div class="links-mobile">
          <div className="hamburger" onClick={toggleHamburger}>
            <Burger isOpen={hamburgerOpen} />
          </div>
        </div>
      </nav>
      <style jsx>{`
        @media (max-width: 1130px) {
          nav {
            margin-left: 0;
            margin-right: 0;
            border-radius: 0;
            padding: 0.2rem 0.5rem;
            

            align-items: center;
            
            z-index: 12;
            

            
            display: flex;
           
            width: 100%;
            justify-content: space-between;
          }
          
          nav .links-mobile .hamburger {
            display: flex;

            z-index: 6;
          }
          nav .links-mobile  {
            padding:10px;
          }
          nav .logo  {
            padding:10px;
          }
          nav .links {
            
            flex-direction:column;
            top:0;
            right:0;
            height: ${hamburgerOpen ? "410px" : "0px"};
            
            width: 100%;
            background:white;
            position: absolute;
            border-radius: 0px;
            filter: drop-shadow(0px 1px 3px rgba(0, 0, 0, 0.76));
            transition: all .5s ease-out;
            
            
          }
          nav .links li {
            max-width: 200px;
            margin-left:auto;
            margin-right:auto;
            margin-bottom:5px;
            width:100%;
            
          }
          
          nav .links li a {
            
            justify-content: center;
            margin-left:auto;
            margin-right:auto;
            height:50px;
            transform:${hamburgerOpen ? "translateY(0)" : "translateY(50)"}; 
            
          }
        }
        }
      `}</style>
    </div>
  );
}

export default Navbar;
